import React, { useState, useEffect } from "react";
import { css } from "@emotion/react";
import { FaMobileAlt } from "react-icons/fa";
import styled from "@emotion/styled";
import MaaS360Data from "../components/Maas360Data";
import Modal from "react-modal";

const DeviceListContainer = styled.div`
  display: flex;
  flex-direction: column;
  margin-top: 2rem;
  background-color: #f5f5f5;
  max-width: 800px;
`;

const DeviceListHeader = styled.h1`
  font-size: 2.5rem;
  margin-bottom: 2rem;
`;

const DeviceListItemContainer = styled.li`
  margin: 1rem 0;
  padding: 1rem;
  background-color: white;
  box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.2);
  border-radius: 8px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 80%;
`;

const DeviceListItemIcon = styled.div`
  font-size: 3.5rem;
`;

const DeviceListItemDetails = styled.div`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  margin-left: 1rem;
`;

const DeviceListItemTitle = styled.h2`
  font-size: 1.5rem;
  margin-bottom: 0.5rem;
`;

const modalStyles = {
  content: {
    top: "50%",
    left: "50%",
    right: "auto",
    bottom: "auto",
    marginRight: "-50%",
    transform: "translate(-50%, -50%)",
  },
};

Modal.setAppElement("#root");

function DeviceList() {
  const [devices, setDevices] = useState([]);
  const [error, setError] = useState(null);
  const [showDevices, setShowDevices] = useState(false);
  const [selectedDevice, setSelectedDevice] = useState(null);
  const [modalIsOpen, setIsOpen] = useState(false);


  useEffect(() => {
    async function fetchDevices() {
      try {
        const data = await MaaS360Data();
        setDevices(data);
      } catch (error) {
        setError(error.message);
      }
    }
    fetchDevices();
  }, []);

  const handleTotalDevicesClick = () => {
    setShowDevices(!showDevices);
  };

  const handleDeviceItemClick = (device) => {
    setSelectedDevice(device);
    setIsOpen(true);
  };

  const closeModal = () => {
    setSelectedDevice(null);
    setIsOpen(false);
  };


  return (
    <div>
      <DeviceListHeader>Device List</DeviceListHeader>
      <DeviceListContainer>
        <div onClick={handleTotalDevicesClick}>
          <div>
            <FaMobileAlt />
          </div>
          <div>{devices.length}</div>
        </div>
        {showDevices && (
          <ul>
            {devices.map((device) => (
              <DeviceListItemContainer key={device.ID}>
                <DeviceListItemIcon>
                  <FaMobileAlt />
                </DeviceListItemIcon>
                <DeviceListItemDetails>
                  <DeviceListItemTitle>
                    {device.device_name}
                  </DeviceListItemTitle>
                  <p>ID: {device.ID}</p>
                  <p>Model: {device.model}</p>
                  <p>Status: {device.deviceStatus}</p>
                  <p>Username: {device.username}</p>
                  <p>Last Reported: {device.lastReported}</p>
                  <p>OS: {device.os}</p>
                  <button onClick={() => handleDeviceItemClick(device)}>
                    View Details
                  </button>
                </DeviceListItemDetails>
              </DeviceListItemContainer>
            ))}
          </ul>
        )}
        {modalIsOpen && selectedDevice && (
          <Modal
            isOpen={modalIsOpen}
            onRequestClose={closeModal}
            contentLabel="Device Details Modal"
          >
            <h2>Device Details</h2>
            <p>ID: {selectedDevice.ID}</p>
            <p>Name: {selectedDevice.device_name}</p>
            <p>Model: {selectedDevice.model}</p>
            <p>Status: {selectedDevice.deviceStatus}</p>
            <p>Username: {selectedDevice.username}</p>
            <p>Last Reported: {selectedDevice.lastReported}</p>
            <p>OS: {selectedDevice.os}</p>
            <button onClick={closeModal}>Close</button>
          </Modal>
        )}
      </DeviceListContainer>
    </div>
  );
}

export default DeviceList;
